// frontend/src/components/InventoryDashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Bar, Doughnut } from 'react-chartjs-2';
import { Card, Row, Col, ListGroup, Button } from 'react-bootstrap';
import 'chart.js/auto';

function InventoryDashboard() {
  const [chartData, setChartData] = useState({ labels: [], datasets: [] });
  const [lowStockProducts, setLowStockProducts] = useState([]);
  const [analytics, setAnalytics] = useState({ totalProducts: 0, lowStockProducts: 0, totalOrders: 0, averageOrderQuantity: 0 });

  useEffect(() => {
    fetchLowStock();
    fetchChartData();
    fetchAnalytics();
  }, []);

  const fetchLowStock = async () => {
    try {
      const res = await axios.get('http://localhost:5001/api/products/low-stock');
      setLowStockProducts(res.data);
    } catch (err) {
      console.error('Error fetching low stock products:', err);
    }
  };

  const fetchChartData = async () => {
    try {
      const res = await axios.get('http://localhost:5001/api/products');
      const products = res.data;
      const labels = products.map(p => p.name);
      const quantities = products.map(p => p.quantity);

      setChartData({
        labels,
        datasets: [
          {
            label: 'Stock Level',
            data: quantities,
            backgroundColor: 'rgba(75,192,192,0.6)',
          }
        ]
      });
    } catch (err) {
      console.error('Error fetching chart data:', err);
    }
  };

  const fetchAnalytics = async () => {
    try {
      const res = await axios.get('http://localhost:5001/api/analytics/inventory-stats');
      setAnalytics(res.data);
    } catch (err) {
      console.error('Error fetching analytics:', err);
    }
  };

  return (
    <div>
      <h2>Inventory Dashboard</h2>
      <Row className="mb-4">
        <Col md={4}>
          <Card>
            <Card.Header>Low Stock Alerts</Card.Header>
            <ListGroup variant="flush">
              {lowStockProducts.length > 0 ? (
                lowStockProducts.map(product => (
                  <ListGroup.Item key={product.id}>
                    {product.name} - {product.quantity} in stock
                  </ListGroup.Item>
                ))
              ) : (
                <ListGroup.Item>No low stock products.</ListGroup.Item>
              )}
            </ListGroup>
          </Card>
          <Card className="mt-4">
            <Card.Header>Analytics Summary</Card.Header>
            <Card.Body>
              <p>Total Products: {analytics.totalProducts}</p>
              <p>Low Stock: {analytics.lowStockProducts}</p>
              <p>Total Orders: {analytics.totalOrders}</p>
              <p>Avg. Order Qty: {analytics.averageOrderQuantity.toFixed(2)}</p>
              <Button variant="primary" size="sm">View Detailed Report</Button>
            </Card.Body>
          </Card>
        </Col>
        <Col md={8}>
          <Card>
            <Card.Header>Stock Levels</Card.Header>
            <Card.Body>
              <Bar data={chartData} />
            </Card.Body>
          </Card>
          <Card className="mt-4">
            <Card.Header>Inventory Composition</Card.Header>
            <Card.Body>
              <Doughnut 
                data={{
                  labels: ['Low Stock', 'Sufficient Stock'],
                  datasets: [{
                    data: [analytics.lowStockProducts, analytics.totalProducts - analytics.lowStockProducts],
                    backgroundColor: ['#FF6384', '#36A2EB'],
                  }]
                }} 
              />
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </div>
  );
}

export default InventoryDashboard;
